<tr>
<td class="sdtext">カテゴリトップ&nbsp;&gt;&nbsp;ライト・照明&nbsp;&gt;&nbsp;ネイル LEDライト

メーカー希望小売価格はメーカーカタログに基づいて掲載しています<br>
【wasser12】wasser LEDデスクライト<br>
<br>
目に優しいおしゃれな北欧風LED電気スタンド。<br>
セードに「LED偏光フィルター」を採用で目に優しい。<br>
タッチセンサー式5段階調光で置き場所に合わせた明るさに調整可能。<br>
フレキシブルアームで自由自在な角度調整。<br>
家庭用コンセントに、本体に付属しているコードを差し込むだけで設置簡単。<br>
LEDライトなので省電力で長寿命とってもエコに節電対策！<br>
清涼感のある昼光色のライトです。<br>
<br>
【特徴】<br>
・LEDの直接的な強い光を抑える「偏光フィルター」。<br>
・フレキシブルアームで自由自在な角度調整可能。<br>
・明るさは5段階の調光が可能。<br>
・軽く触れるだけでON/OFF/調光が出来るタッチセンサー。<br>
・省エネ、長寿命なLEDチップ使用。<br>
・消費電力は最大約6W。<br>
<br>
5段階調光が可能なおしゃれなLEDデスクライト。<br>
光源にはLED偏光フィルターを採用！<br>
従来のLEDライトの直接的な強い光をフィルターを通して柔らかくすることにより<br>
反射を抑え、自然に照らすので、目に優しく疲れにくい光になっています。<br>
<br>
LEDライトは白熱灯や蛍光灯と比べて低発熱で、紫外線や遠赤外線が少ないという特性があり、<br>
室内温度への影響や、照射面での火傷のリスクがほとんどない安心仕様。<br>
物の劣化焼け等も軽減され、虫もよりにくくなっています。<br>
<br>
フレキシブルアームで角度調整は自由自在！<br>
場所を選ばない自由度の高さが嬉しいLEDライトです。<br>
<br>
ありそうでなかった真っ白でツヤ感のあるオシャレなボディ。<br>
タマゴ型のベースが卓上の雰囲気を柔らかく演出、<br>
セードのトップには飾り穴が空いているので、ライトの光が優しくこぼれます。<br>
重さは約1.2kgなので持ち運びも簡単です。<br>
<br>
安心設計＆安心価格＆安心保障（１年保証）<br>
３つの安心を約束！<br>
<br>
規格<br>
サイズ：最大約H520×W170×D200mm<br>
電源：AC100V 50Hz/60Hz <br>
調光：5段階<br>
光色：昼光色<br>
電球タイプ：長寿命LED電球（交換不要）<br>
明るさ：最大約1880Lx(高さ30cmから照射した場合)<br>
消費電力：最大約6W <br>
電源コード：約１.5ｍ<br>
重さ：約1260g<br>
