<td class="sdtext">カテゴリトップ&nbsp;&gt;&nbsp;ライト・照明&nbsp;&gt;&nbsp;デスクライト&nbsp;&gt;&nbsp;LED

メーカー希望小売価格はメーカーカタログに基づいて掲載しています<br>
【wasser10】wasser LEDデスクライト<br>
<br>
シンプルだけど本格派、目に優しいおしゃれな面発光LED卓上ライト。<br>
タッチパネルで5段階の調光と3パターンの調色が可能。<br>
90度×160度×90度の自由自在な角度調整。<br>
家庭用コンセントに、本体に付属しているコードを差し込むだけで設置簡単。<br>
LEDライトなので省電力で長寿命でエコ！節電対策に！<br>
電球色から白色まで、調色機能で、学習机や読書、オフィスにもピッタリ。<br>
USBポート付きで充電などもできる！<br>
電気代を気にせずに長時間使えるデスクライトです。<br>
<br>
【特徴】<br>
・LED新技術、面発光採用の目にやさしいライト。<br>
・軽く触れるだけでON/OFF/調光/調色が出来るタッチパネル。<br>
・タッチパネルは5段階の調光と、電球色、昼白色、昼光色の3パターン調色。<br>
・90度×160度×90度の自由自在な角度調整可能。<br>
・便利なUSBポート付き。<br>
・省エネ、長寿命なLEDチップ使用。<br>
・消費電力は最大約10W。<br>
<br>
5段階調光と3パターンの調色が可能なおしゃれなLED電気スタンド。<br>
全15パターンの明かりで、長時間ライトを使うビジネスシーンだけでなく、<br>
お子さまのお部屋やリビング等に合わせてお好みの光の色と明るさを調節していただけます。<br>
白熱灯や蛍光灯と比べて低発熱で、紫外線や遠赤外線が少ないという特性があり、<br>
室内温度への影響や、照射面での火傷のリスクがほとんどない安心仕様。<br>
物の劣化焼け等も軽減され、虫もよりにくくなっています。<br>
<br>
３点のヒンジで角度調整は自由自在！<br>
場所を選ばない自由度の高さが嬉しいLEDライトです。<br>
<br>
シンプルな角丸のセードと広いベースでやさしい雰囲気のデザイン。<br>
重さは約1.1kg＋持ち手付きで持ち運びも簡単です。<br>
<br>
<b>安心設計＆安心価格＆安心保障（１年保証）</b><br>
３つの安心を約束！<br>
<br>
規格<br>
サイズ：最大約H690×W140×D200mm<br>
電源：AC100V 50Hz/60Hz<br>
出力：5V/500mA <br>
調光：5段階<br>
光色：3パターン<br>
明るさ：最大約850Lm<br>
消費電力：最大約10W <br>
電源コード：約１.8ｍ<br>
重さ：約1.1kg<br>
素材：ABS<br>
<br>
【充電ポートについて】<br>
こちらの商品のUSB充電ポートの出力は500mAh(0.5A)となっております。<br>
iPadをはじめ、充電に必要な電力が多い機器には充電ができませんので予めご了承ください。<br>
<br>
※画像は使用イメージです。<br>
iPhoneやアンドロイドなどの機器用充電ケーブルは付属しておりません。<br>
