【wasser09】wasser LED卓上ライト09<br>
<br>
目に優しいおしゃれなLED卓上ライト。<br>
タッチパネルで６段階の調光と調色が可能。<br>
チルト構造で自由自在な角度調整。<br>
家庭用コンセントに、本体に付属しているコードを差し込むだけで設置簡単。<br>
LEDライトなので省電力で長寿命とってもエコ！<br>
電球色から白色まで、調色機能で、学習机や読書、オフィスにもピッタリ。<br>
電気代を気にせずに長時間使えるデスクスタンドライトです。<br>
<br>
【特徴】<br>
・タッチパネルで６段階の調光と調色。<br>
・チルト構造で自由自在な角度調整可能。<br>
・軽く触れるだけでON/OFF/調光/調色が出来るタッチパネル。<br>
・30秒タイマー付きで便利。<br>
・省エネ、長寿命なLEDチップ使用。<br>
・消費電力は最大約6W。<br>
<br>
6段階調光と調色が可能なおしゃれなLED卓上ライト。<br>
明るさだけでなく、電球色、白昼色、白色の調色も可能で<br>
36パターンの明かりで長時間ライトを使うビジネスシーンだけでなく、<br>
お子さまのお部屋やリビング等お好みの光の色と明るさを調節していただけます。<br>
白熱灯や蛍光灯と比べて低発熱で、紫外線や遠赤外線が少ないという特性があり、<br>
室内温度への影響や、照射面での火傷のリスクがほとんどない安心仕様。<br>
物の劣化焼け等も軽減され、虫もよりにくくなっています。<br>
<br>
ネックのヒンジに加えてセードはチルト構造で角度調整は自由自在！<br>
場所を選ばない自由度の高さが嬉しいLEDライトです。<br>
<br>
シンプルな角丸のセードと広いベースでやさしい雰囲気のデザイン。<br>
重さは約1.2kgなので持ち運びも簡単です。<br>
<br>
安心設計＆安心価格＆安心保障（１年保証）<br>
３つの安心を約束！<br>
<br>
