<tr>
<td class="sdtext">カテゴリトップ&nbsp;&gt;&nbsp;ブランドで選ぶ&nbsp;&gt;&nbsp;LED照明&nbsp;&gt;&nbsp;Wasser ヴァッサ ledライト

メーカー希望小売価格はメーカーカタログに基づいて掲載しています<br>
wasser26 LED卓上ライト<br>
<br>
レトロなダイヤルがアクセントのデスクライト。<br>
ブラックとシルバーのシンプルでクールなデザイン。<br>
その個性的なボディにはLEDの最新技術や特許機能を搭載。<br>
ダイヤル式調光をはじめ、電球色（オレンジ色）から白昼色（白色）まで、色温度も無段階で自在に変える事ができるので、<br>
用途に合わせて心地よい環境を作ってくれます。<br>
細身のネックと左右90度×上下160度に動くセードでお好みの角度へ調整。<br>
さらにUSBポート（出力5V/1A）付でお手持ちの機器と充電コードを使って充電ができます。<br>
wasserシリーズは進化をしながらも古き良き時代のシルエットを再現します。<br>
LEDライトなので省電力で長寿命とってもエコに節電対策！<br>
調色機能で、学習机や読書、オフィスにもピッタリ。<br>
電気代を気にせずに長時間使えるデスクスタンドライトです。<br>
<br>
【特徴】<br>
・アナログ感を残した調光ダイヤル。<br>
・シンプルな操作性。<br>
・軽く触れるだけでON/OFF/調色が出来るタッチボタン。<br>
・電球色～昼白色～昼光色の調色と調光は無段階。<br>
・USBポートで。<br>
・省エネ、長寿命なLED使用。<br>
・独自デザインのLEDで目に優しい。<br>
・消費電力は最大約10W。<br>
<br>
LEDは白熱灯や蛍光灯と比べて低発熱で、紫外線や遠赤外線が少ないという特性があり、<br>
室内温度への影響や、照射面での火傷のリスクがほとんどない安心仕様。<br>
物の劣化焼け等も軽減され、虫もよりにくくなっています。<br>
<br>
安心設計＆安心価格＆安心保障（１年保証）<br>
３つの安心を約束！<br>
<br>
カラー：ブラック<br>
<br>
規格<br>
サイズ：最大約H478×W175×D210mm<br>
重さ：約1.05kg<br>
<br>
電源：AC100V-240V 50Hz/60Hz <br>
調光：無段階<br>
光色：無段階（電球色/昼白色/昼光色）<br>
明るさ：最大約1200Lux(高さ30cmから照射した場合)<br>
消費電力：最大約10W <br>
電源コード：約１.29ｍ<br>
素材：ABS/アルミ<br>
